/**
 * @remarks
 * Notes on plugins we _don't_ use:
 *
 *  ## plugin:react-hooks
 *  We don't use the react hooks plugin because it disallows valid use-cases
 *  such as this:
 *
 *  ```ts
 *  export default function useValToAtom<S>(val: S): Atom<S> {
 *  const atom = useMemo(() => {
 *    return new Atom(val)
 *  }, []) // <-- we don't _need_ to include `val` here, but the lint rule will require it
 *
 *  useLayoutEffect(() => {
 *    atom.setState(val)
 *  }, [val]) // <-- we also know `atom` will never change, but the lint rule doesn't
 *
 *  return atom
 * ```
 *
 * @type {import("eslint").Linter.Config}
 */
module.exports = {
  root: true,
  plugins: ['unused-imports', 'eslint-plugin-tsdoc', 'import', 'react'],
  settings: {
    react: {
      version: '18.2',
    },
  },
  extends: [],
  rules: {
    'unused-imports/no-unused-imports': 'warn',
    'tsdoc/syntax': 'warn',
    'no-debugger': 'error',
    'react/no-deprecated': 'error',

    'no-restricted-imports': [
      'error',
      {
        paths: [
          {
            name: 'lodash',
            message: 'Use lodash-es which is tree-shaking friendly',
          },
        ],
      },
    ],
  },
  ignorePatterns: ['*.d.ts', '*.ignore.ts', 'compat-tests/*'],
  overrides: [
    {
      files: ['*.ts', '*.tsx'],
      parser: '@typescript-eslint/parser',
      plugins: ['@typescript-eslint'],
      parserOptions: {
        project: [
          './packages/*/tsconfig.json',
          './packages/*/devEnv/tsconfig.json',
          './examples/*/tsconfig.json',
          './devEnv/tsconfig.json',
          './compat-tests/tsconfig.json',
        ],
      },
      rules: {
        '@typescript-eslint/await-thenable': 'warn',
        '@typescript-eslint/no-throw-literal': 'warn',
        '@typescript-eslint/switch-exhaustiveness-check': 'error',
        '@typescript-eslint/consistent-type-imports': [
          'warn',
          {
            prefer: 'type-imports',
          },
        ],
        '@typescript-eslint/no-unused-vars': 'off',
        '@typescript-eslint/no-floating-promises': 'warn',
      },
    },
    {
      plugins: ['react'],
      files: ['*.mjs', '*.js'],
      rules: {
        'react/jsx-uses-react': 'error',
        'react/jsx-uses-vars': 'error',
        'tsdoc/syntax': 'off',
      },
      parser: 'espree',
      parserOptions: {
        sourceType: 'module',
        ecmaVersion: 2021,
        ecmaFeatures: {
          jsx: true,
        },
      },
    },
  ],
}

/** @type {import('jest').Config} */
module.exports = {
  testMatch: [
    '<rootDir>/compat-tests/fixtures/*/*.compat-test.ts',
    '<rootDir>/compat-tests/*.compat-test.ts',
  ],
  moduleNameMapper: {},
  modulePathIgnorePatterns: ['<rootDir>/compat-tests/verdaccio'],
  automock: false,
  // transform: {
  //   '^.+\\.tsx?$': [
  //     'esbuild-jest',
  //     {
  //       sourcemap: true,
  //     },
  //   ],
  //   '^.+\\.js$': [
  //     'esbuild-jest',
  //     {
  //       sourcemap: true,
  //     },
  //   ],
  // },
  moduleFileExtensions: ['ts', 'tsx', 'js', 'jsx', 'json', 'node'],
  // these tests take a long time to run, because each of them either runs a full build of a package,
  // or tests the build on a browser using playwright
  testTimeout: 1000 * 60 * 2,
  transform: {
    '^.+\\.tsx?$': [
      'jest-esbuild',
      {
        sourcemap: true,
        supported: {
          'dynamic-import': false,
        },
      },
    ],
    '^.+\\.js$': [
      'jest-esbuild',
      {
        sourcemap: true,
        supported: {
          'dynamic-import': false,
        },
      },
    ],
  },
}

/** @type {import('jest').Config} */
module.exports = {
  testMatch: [
    '<rootDir>/packages/*/src/**/*.test.ts',
    '<rootDir>/devEnv/**/*.test.ts',
  ],
  moduleNameMapper: {
    ...require('./devEnv/getAliasesFromTsConfig').getAliasesFromTsConfigForJest(),
    '\\.(css|svg|png)$': 'identity-obj-proxy',
    'lodash-es/(.*)': 'lodash/$1',
    'react-use/esm/(.*)': 'react-use/lib/$1',
    'lodash-es': 'lodash',
    // ES modules that jest can't handle at the moment.
    uuid: '<rootDir>/node_modules/uuid/dist/index.js',
    nanoid: '<rootDir>/node_modules/nanoid/index.cjs',
    'nanoid/non-secure': '<rootDir>/node_modules/nanoid/non-secure/index.cjs',
    'react-icons/(.*)': 'identity-obj-proxy',
    'react-merge-refs': 'identity-obj-proxy',
    '@trpc/client': 'identity-obj-proxy',
    oauth4webapi: 'identity-obj-proxy',
  },
  setupFiles: [
    './packages/studio/src/integration-tests/setupIntegrationTestEnv.ts',
  ],
  automock: false,
  transform: {
    '^.+\\.tsx?$': [
      'jest-esbuild',
      {
        sourcemap: true,
        supported: {
          'dynamic-import': false,
        },
      },
    ],
    '^.+\\.js$': [
      'jest-esbuild',
      {
        sourcemap: true,
        supported: {
          'dynamic-import': false,
        },
      },
    ],
  },
  moduleFileExtensions: ['ts', 'tsx', 'js', 'jsx', 'json', 'node'],
}

{
  "$schema": "https://unpkg.com/knip@3/schema.json",
  "entry": [
    "packages/*/src/index.{ts,tsx}",
    "packages/*/devEnv/**/*.{ts,js}",
    "devEnv/**/*.{ts,js}",
    "packages/playground/src/**/*.{ts,tsx}"
  ],
  "project": ["packages/*/{src,devEnv}/**/*.{ts,tsx,js,mjs}"],
  "typescript": {
    "config": "packages/*/tsconfig.json"
  }
}

{
  "packages": ["packages/*", "theatre/*"],
  "version": "independent",
  "npmClient": "yarn",
  "useWorkspaces": true
}

module.exports = () => {
  return {
    autoDetect: true,
    tests: [
      'theatre/**/*.test.ts',
      'packages/dataverse/**/*.test.ts',
      '!**/node_modules/**',
    ],
    testFramework: {
      configFile: './jest.config.js',
    },
  }
}
